import React from 'react';
import {NavLink} from 'react-router-dom';
const Menu=()=>{
    return(<>
            <NavLink  to='/'>aboutus</NavLink>
            <NavLink  to='/contact'>contact </NavLink>
            <br />
            <a href='/'>aboutus</a>
            <a href='/contact'>contact</a>


            </>)
}
export default Menu;
